import { makeStyles } from '@material-ui/core/styles'

export default makeStyles((theme) => ({
    mainContainer: {
        display: 'flex',
        flexDirection: 'column',
        margin: 'auto',
        width:'fit-content'
    },
    formControl:{
            marginTop: theme.spacing(1),
            minWidth: 100,
    }
}))
